import React, { Component } from 'react';
import '../css/tab_css.css';

const company_name = [
  {
    company: 'Tesla',
    icon_url: '../images/hyundai/hu3.jpg',
  },
  {
    company: 'Lexus',
    icon_url: '../images/hyundai/hu3.jpg',
  },
  {
    company: 'Hyundai',
    icon_url:
      'https://images.hdqwalls.com/wallpapers/thumb/2021-rolls-royce-ghost-vn.jpg',
  },
];

class Tabs extends Component {
  // tabs = ()=>{

  // }
  render() {
    return (
      <div>
        <div className="tablet">
          {company_name.map((n) => (
            <div className="tab"><img src={n.icon_url} /></div>
          ))}
        </div>
      </div>
    );
  }
}

export default Tabs;
